import React, { useState, useEffect } from 'react';
import { BookOpen, Search, ShoppingCart, Bell, User } from 'lucide-react';

const Navbar = ({ setCurrentPage }) => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [isScrolled, setIsScrolled] = useState(false);

  useEffect(() => {
    // Check for auth token to determine login status
    const token = localStorage.getItem('token');
    setIsLoggedIn(!!token);

    // Handle scroll effect for navbar background
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 10);
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('token');
    setIsLoggedIn(false);
    setCurrentPage('home'); // or 'login'
  };

  const navTextColor = isScrolled ? 'text-gray-700' : 'text-white';

  return (
    <nav className={`fixed top-0 left-0 right-0 z-50 transition-all duration-300 ${isScrolled ? 'bg-white shadow-lg' : 'bg-transparent'}`}>
      <div className="container mx-auto px-6 py-3 flex justify-between items-center">
        {/* Left Side: Logo and Categories */}
        <div className="flex items-center space-x-8">
          <div 
            className="flex items-center cursor-pointer"
            onClick={() => setCurrentPage('home')}
          >
            <BookOpen className="h-8 w-8 text-purple-600" />
            <span className={`ml-2 text-2xl font-bold ${navTextColor}`}>Learnify</span>
          </div>
          <div className="hidden md:block">
            <button className={`font-semibold ${navTextColor} hover:text-purple-600`}>
              Categories
            </button>
          </div>
        </div>

        {/* Middle: Search Bar (larger screens) */}
        <div className="hidden lg:flex flex-grow mx-8 max-w-xl">
          <div className="relative w-full">
            <span className="absolute inset-y-0 left-0 flex items-center pl-3">
              <Search className="h-5 w-5 text-gray-400" />
            </span>
            <input 
              type="text" 
              placeholder="Search for anything" 
              className="w-full bg-white border border-gray-300 rounded-full py-2 pl-10 pr-4 focus:outline-none focus:ring-2 focus:ring-purple-500"
            />
          </div>
        </div>

        {/* Right Side: Actions and Auth */}
        <div className="flex items-center space-x-2 md:space-x-4">
          <button className={`hidden md:block font-semibold ${navTextColor} hover:text-purple-600`}>My Learning</button>
          <button className={`p-2 rounded-full ${navTextColor} hover:bg-black/10`}>
            <ShoppingCart className="h-6 w-6" />
          </button>

          {isLoggedIn ? (
            <div className="relative group">
              <button className="h-10 w-10 bg-purple-600 rounded-full flex items-center justify-center text-white font-bold text-lg">
                <User />
              </button>
              <div className="absolute right-0 mt-2 w-48 bg-white rounded-md shadow-xl z-20 hidden group-hover:block">
                <a href="#" className="block px-4 py-2 text-sm text-gray-700 hover:bg-purple-500 hover:text-white">Profile</a>
                <button onClick={handleLogout} className="w-full text-left block px-4 py-2 text-sm text-gray-700 hover:bg-purple-500 hover:text-white">Log Out</button>
              </div>
            </div>
          ) : (
            <div className="hidden md:flex items-center space-x-2">
              <button onClick={() => setCurrentPage('login')} className={`px-4 py-2 font-semibold rounded-md border ${isScrolled ? 'border-gray-800 text-gray-800 hover:bg-gray-800 hover:text-white' : 'border-white text-white hover:bg-white hover:text-black'}`}>Log In</button>
              <button onClick={() => setCurrentPage('signup')} className="px-4 py-2 font-semibold rounded-md bg-purple-600 text-white hover:bg-purple-700">Sign Up</button>
            </div>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
